import './styles.css';

function MainInfoComponent() {
    return (
        <div className="MainInfoComponent">
            My far-reaching passions are: ideas, art, technology and people. My dream is to help create  new and inspiring innovations, be that in the fields of philosophy, literature, mathematics, technology or, most impelling: the intersection of these.

            I’m awed by the immensely wonderful culture we are a part of, and thrilled when attempting to conceive what may come next. I am optimistic and skeptical.

            I’m constantly trying to undertake new challenges and I’m usually somewhat reserved and expectant at the start when confronted with the new. Nevertheless, I constantly work on mastering new fields and once I’ve become confident enough, I dare bring to the table the most important unknowns that I foresee awaiting the current state of affairs. In team discussions, I like pondering those ideas that I feel are the most understated and giving them a say.
        </div>
    );
}

export default MainInfoComponent;
